/*Table structure for table `coupons` */

DROP TABLE IF EXISTS `coupons`;

CREATE TABLE `coupons` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(256) DEFAULT NULL,
  `slug` varchar(256) NOT NULL,
  `description` text,
  `code` varchar(20) NOT NULL,
  `type` enum('percent','value') NOT NULL DEFAULT 'value',
  `value` decimal(10,0) NOT NULL,
  `start_date` datetime DEFAULT NULL,
  `end_date` datetime DEFAULT NULL,
  `minimum_amount` decimal(10,0) DEFAULT NULL,
  `max_users` int(11) DEFAULT NULL,
  `user_once_per_customer` enum('Yes','No') DEFAULT 'No',
  `categories` text,
  `exclude_products` text,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `status` enum('Active','Inactive') NOT NULL DEFAULT 'Active',
  `user_created` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

/*Data for the table `coupons` */

insert  into `coupons`(`id`,`title`,`slug`,`description`,`code`,`type`,`value`,`start_date`,`end_date`,`minimum_amount`,`max_users`,`user_once_per_customer`,`categories`,`exclude_products`,`created_at`,`updated_at`,`status`,`user_created`) values (1,'Festaval Offer','festaval-offer','<p>ffasfafaasd</p>\r\n','321456','percent',50,'2017-03-15 14:12:00','2017-03-24 15:17:00',20,0,'Yes','[\"4\",\"6\"]','null','2017-03-07 10:01:18','2017-03-23 12:26:21','Active',1),(2,'Test Coupon','test-coupon','<p>test</p>\r\n','TEST','percent',20,'2017-03-22 00:00:00','2017-08-31 00:00:00',2,5,'Yes','[\"2\",\"3\",\"4\",\"5\",\"6\",\"9\",\"10\",\"29\"]','null','2017-03-22 12:15:28','2017-03-22 12:15:28','Active',1);

/*Table structure for table `emailtemplates` */

DROP TABLE IF EXISTS `emailtemplates`;

CREATE TABLE `emailtemplates` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `type` enum('header','footer','content') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'content',
  `subject` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `content` text COLLATE utf8_unicode_ci NOT NULL,
  `from_email` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `from_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `record_updated_by` int(50) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `related_to` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `emailtemplates` */

