  CONSTRAINT `fk_user_id` FOREIGN KEY (`user_created`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

