/*Table structure for table `tourapplications` */

DROP TABLE IF EXISTS `tourapplications`;

CREATE TABLE `tourapplications` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date DEFAULT NULL,
  `travel_mode` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `ticket_cost` decimal(10,2) NOT NULL,
  `cab_cost_home` decimal(10,2) NOT NULL,
  `cab_cost_destination` decimal(10,2) NOT NULL,
  `hotel_cost` decimal(10,2) NOT NULL,
  `manager_id` int(10) unsigned DEFAULT NULL,
  `status` enum('draft','submitted','approved','rejected','request_for_information','moved_to_finance_manager') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'draft',
  `submitted_by` int(10) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `submitted_by` (`submitted_by`),
  KEY `manager_id` (`manager_id`),
  CONSTRAINT `tourapplications_ibfk_1` FOREIGN KEY (`submitted_by`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `tourapplications` */

insert  into `tourapplications`(`id`,`title`,`slug`,`description`,`start_date`,`end_date`,`travel_mode`,`ticket_cost`,`cab_cost_home`,`cab_cost_destination`,`hotel_cost`,`manager_id`,`status`,`submitted_by`,`created_at`,`updated_at`) values (1,'First Travel','first-travel','There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words ','2017-01-01','2017-01-03','Flight',600.00,50.00,200.00,800.00,4,'moved_to_finance_manager',2,'2017-01-26 01:49:44','2017-01-26 04:41:15'),(2,'Second Travel','second-travel','This is my second travel to the same place','2017-01-22','2017-01-28','Train',300.00,123.00,222.00,455.00,4,'submitted',2,'2017-01-26 04:16:34','2017-01-26 04:40:35'),(3,'Third Tour','third-tour','This is my third tour','2017-01-30','2017-02-05','Bus',200.00,122.00,44.00,245.00,4,'draft',2,'2017-01-26 04:39:41','2017-01-26 04:39:41');

